import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Navbar from './navbar';
import Bhajanamindralu from '../components/bhajanmindralu';
import Users from '../components/users';
import Reports from '../components/reports';
import Home from './home';
import './landing.css';

const Landing = () => {
  const [activePage, setActivePage] = useState('');
  const navigate = useNavigate();

  const renderPageContent = () => {
    if (activePage === '') {
      return <Home />;
    }
    switch (activePage) {
      case 'Home':
        return <Home />;
      case 'bhajanamindralu':
        return <Bhajanamindralu />;
      case 'users':
        return <Users />;
      case 'reports':
        return <Reports />;
      default:
        return null;
    }
  };

  const navigateToPage = (page) => {
    setActivePage(page);
    navigate(`/${page}`);
  };

  return (
    <div className="landing-container">
      <Navbar setActivePage={navigateToPage} activePage={activePage} />
      <div className="page-content-container">
        <div className="page-content">{renderPageContent()}</div>
      </div>
    </div>
  );
};

export default Landing;
